import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import './App.css';
// import Navbar from './components/Navbar.js'
import Warmups from './pages/warmups.js'
import Home from './pages/home.js'
import CssPage from './pages/css.js';
import ReactPage from './pages/react.js';



function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />

      </div>
        <Routes>
          <Route exact path="/warmups" component={ <Warmups/> } />
          <Route path="/react" component={ <ReactPage /> } />
          <Route path="/css" component={ <CssPage />} />
          <Route path="./pages/home.js" component={ <Home/> } />
        </Routes>

    </Router>

  );
}

function Navbar() {
  return (
      <nav>
          <h2>Byte Sized Web</h2>
          <ul>
              <li><Link to="./pages/home.js">Home</Link></li>
              <li><Link to="./pages/warmups.js">Warm ups</Link></li>
              <li><Link to="./pages/react.js">React</Link></li>
              <li><Link to="./pages/css.js">CSS</Link></li>
          </ul>
      </nav>
  )
}

export default App;
